pragma solidity ^0.8.13;

contract TrustAccessData {

    address private contactOwner;
    bool private operational = true;

    uint apartmentCount; 
    uint residentCount; 

    constructor() {
        contactOwner = msg.sender;
    }

    mapping(address => Apartment) public apartments;
    mapping(address => Resident) public residents;
    mapping(address => Apartment[]) public residentApartments;


    event ApartmentRegistered(address _apartmentAddress, string _name );
    event ResidentRegistered( address _ownerAddress, string _name );

    function numberOfResidents()
        external
        view
        returns (uint)
    {
        return residentCount;
    }

    function numberOfApartments()
        external
        view
        returns (uint)
    {
        return apartmentCount;
    }

    function registerApartment( address _apartmentAddress, string memory _name ) 
        public 
        returns(bool success)
    {

        apartments[_apartmentAddress].id = apartmentCount;
        apartments[_apartmentAddress].name = _name;
        apartments[_apartmentAddress].status = ApartmentStatus.Active;

        apartmentCount = apartmentCount + 1;

        emit ApartmentRegistered(_apartmentAddress, _name);

        return true;
    }

    function registerResident( address _ownerAddress, string memory _name ) 
        public 
        returns(bool success)
    {
        require(_ownerAddress == address(0), "Resident with address already registered");

        residents[_ownerAddress].id = residentCount;
        residents[_ownerAddress].name = _name;
        residents[_ownerAddress].isActive = true;

        residentCount = residentCount + 1;

        emit ResidentRegistered(_ownerAddress, _name);

        return true;
    }

    function assignResidentToApartment ( address _resident, address _apartment )
        public
        returns(bool success)
    {
        require( apartments[_apartment].apartment != address(0), "Apartment with address does not exist");

        Apartment memory apartment = apartments[_apartment];

        residentApartments[_resident].push(apartment);
        return true;
    }

    enum ApartmentStatus { 
        Inactive,
        Active,
        Suspended
    }

    enum ApartmentResidentsStatus {
        Inactive,
        Active
    }

    struct Apartment {
        uint id;
        ApartmentStatus status;
        address apartment;
        string name; 
    }

    struct Resident {
        uint id;
        string name;
        bool isActive;
    }

    struct ApartmentResidents {
        address apartmentAddress;
        address residentAddress;
        ApartmentResidentsStatus status; 
    }

    struct Appointments {
        address resident;
        address visitor;
    }
}
